‚ù§Ô∏è Bahan Isi :
1 sdm Butter 
3 bj Bawang Putih cincang halus 
Sedikit Bawang Prei iris tipis
1 sdm Terigu Serbaguna
100 ml Susu cair
50 gr Daging ayam, kukus dan potong dadu
100 gr Wortel, rebus lalu potong dadu kecil 
75 gr Keju Parut
¬Ω sdt Merica Bubuk 
1 sdt Bumbu Jamur 
¬Ω sdm Gula 

Cara buat :
üßÑ Panaskan butter , tumis bawang putih dan bawang prei sampai layu, masukkan terigu sambil terus diaduk sampai menggumpal. 
üßÑTambahkan susu cair, aduk terus hingga mengental. 
üßÑTambahkan daging ayam dan wortel. Aduk rata. 
üßÑTerakhir tambahkan bumbu jamur, gula dan merica bubuk, kemudian keju parut lalu aduk hingga merata. Koreksi rasa. Angkat dan sisihkan.

‚ù§Ô∏è Bahan Cake :
5 btr Kuning Telor
2 btr Putih Telor 
30 gr Gula pasir
40 gr Terigu Serbaguna
40 gr Butter lelehkan
¬Ω sdt Vanila Paste

Add : 
Keju Cheddar parut untuk hiasan. 

