ü•ö Terakhir, masukkan butter leleh dan vanila paste, aduk balik dengan spatula hingga merata.
ü•ö Tuang ke dalam cetakan muffin yang sudah dialas cup kerta, tuang adonan hingga ¬Ω tinggi cup.
ü•ö Beri 1 sdt isiannya, lalu tuang lagi adonan cake hingga setinggi cup kertas
